import React from "react";
import { Link } from "react-router-dom";
import "../styles/theme.css";

export default function Navbar({ darkMode, setDarkMode }) {
  return (
    <nav style={{ padding: "1rem", display: "flex", justifyContent: "space-between", alignItems: "center" }}>
      <h2 style={{ margin: 0 }}>HireVisor</h2>
      <div>
        <Link to="/" style={{ margin: "0 1rem" }}>Home</Link>
        <Link to="/login" style={{ margin: "0 1rem" }}>Login</Link>
        <Link to="/signup" style={{ margin: "0 1rem" }}>Signup</Link>
        <Link to="/interview-setup" style={{ margin: "0 1rem" }}>Interview</Link>
        <button onClick={() => setDarkMode(!darkMode)} style={{ marginLeft: "1rem", padding: "0.5rem 1rem" }}>
          {darkMode ? "‚òÄÔ∏è Light" : "üåô Dark"}
        </button>
      </div>
    </nav>
  );
}
